gh this process.'=>'Endre e-handelsplattformer kan virke som et stort hinder å overvinne, men det er enklere enn du kanskje tror å flytte produkter, kunder, og ordre til WooCommerce. Denne artikkelen vil hjelpe deg med å gå gjennom denne prosessen.','Do you want to migrate from Shopify to WooCommerce?'=>'Vil du migrere fra Shopify til WooCommerce?','WooCommerce Subscriptions allows you to introduce a variety of subscriptions for physical or virtual products and services. Create product-of-the-month clubs, weekly service subscriptions or even yearly software billing packages. Add sign-up fees, offer free trials, or set expiration periods.'=>'WooCommerce Abonnementer lar deg introdusere en rekke abonnementer for fysiske eller virtuelle produkter og tjenester. Opprett klubber, ukentlige tjenesteabonnementer eller til og med årlige programvarefaktureringspakker. Legg til registreringsgebyrer, tilby gratis prøveversjoner eller angi utløpsperioder.','Do you need more info about WooCommerce Subscriptions?'=>'Trenger du mer informasjon om WooCommerce-abonnementer?','There was a problem activating some of the requested plugins.'=>'Det oppstod et problem under aktivering av noen av de forespurte utvidelser.','Plugins were successfully activated.'=>'Utvidelser aktivert.','The requested plugin `%s`. is not yet installed.'=>'Den forespurte utvidelsen  `%s` er ennå ikke installert.','There was a problem installing some of the requested plugins.'=>'Det oppstod et problem under instalering av noen av de forespurte utvidelser.','Plugins were successfully installed.'=>'Utvidelser ble installert.','The requested plugin `%s` could not be installed. Upgrader install failed.'=>'Den forespurte utvidelsen %s kunne ikke installeres.  Oppgraderingsinstallasjonen mislyktes.','Plugins must be a non-empty array.'=>'Utvidelser må være en ikke-tom array.','Registers whether the note is deleted or not'=>'Registrerer om notatet er slettet eller ikke','The image of the note, if any.'=>'Bildet av not