rivacy-full">PayPal Privacy Policy</a> for flere detaljer.','We accept payments through PayPal. When processing payments, some of your data will be passed to PayPal, including information required to process or support the payment, such as the purchase total and billing information.'=>'Vi aksepterer betalinger gjennom PayPal. Når betalingen behandles, vil noen av opplysningene dine overføres til PayPal, inkludert informasjon som er nødvendig for å gjennomføre eller behandle betalingen, slik som kjøpesum og betalingsinformasjon.','In this subsection you should list which third party payment processors you’re using to take payments on your store since these may handle customer data. We’ve included PayPal as an example, but you should remove this if you’re not using PayPal.'=>'I dette avsnittet bør du lage en liste over hvilke tredjepartsleverandører du bruker til å ta i mot betalinger i nettbutikken din, siden disse kan komme til å behandle personopplysninger. Vi har inkludert PayPal som eksempel, men du burde fjerne dette hvis du ikke bruker PayPal.','We share information with third parties who help us provide our orders and store services to you; for example --'=>'Vi deler opplysninger med tredjepartsleverandører som hjelper oss med å behandle ordre og levere nettbutikktjenesten; for eksempel --','In this section you should list who you’re sharing data with, and for what purpose. This could include, but may not be limited to, analytics, marketing, payment gateways, shipping providers, and third party embeds.'=>'I denne seksjonen bør du ha en liste over hvem du deler opplysninger med, og hvorfor du gjør det. Dette kan inkludere, men ikke være begrenset til: analyse, markedsføring, betalingsløsninger, fraktleverandører og andre tredjepartsleverandører.','What we share with others'=>'Hva vi deler med andre','Our team members have access to this information to help fulfill orders, process refunds and support you.'=>'Vår stab har tilgang til denne informasjonen for å hjelpe til med å gjennomføre ordre, behandle refunderinger og gi deg kundestøtte.','Customer information like your name, email address, and billing and shipping information.'=>'Kundeopplysninger som for eksempel navn, e-postadresse samt faktura- og leveringsadresse.','Order information like what was purchased, when it was purchased and where it should be sent, and'=>'Ordreinformasjon, slik som hva som er kjøpt, når det ble kjøpt og hvor det skal bli fraktet til, og','Members of our team have access to the information you provide us. For example, both Administrators and Shop Managers can access:'=>'Medlemmer av teamet vårt har tilgang til informasjonen du gir oss. For eksempel kan både administratorer og butikkadministratorer få tilgang til:','Who on our team has access'=>'Hvem som har tilgang','We will also store comments or reviews, if you choose to leave them.'=>'Vi tar også vare på kommentarer og omtaler, hvis du velger å skrive dem.','We generally store information about you for as long as we need the information for the purposes for which we collect and use it, and we are not legally required to continue to keep it. For example, we will store order information for XXX years for tax and accounting purposes. This includes your name, email address and billing and shipping addresses.'=>'Som hovedregel oppbevarer vi kun opplysninger om deg så lenge vi trenger dem til de formål som opplysningene er samlet inn til, og vi ikke lenger er lovpålagt å beholde dem. Vi vil for eksempel oppbevare ordreinformasjon i X år av regnskaps- og avgiftsmessige årsaker. Dette inkluderer navn og e-postadresse, samt faktura- og leveringsadresse.','If you create an account, we will store your name, address, email and phone number, which will be used to populate the checkout for future orders.'=>'Hvis du oppretter en konto, lagrer vi ditt navn, adresse, e-post og telefonnummer, som vil bli brukt til å fylle ut kassen for fremtidige ordre.','Send you marketing messages, if you choose to receive them'=>'Send deg markedsføringsmeldinger, hvis du velger å motta dem','Improve our store offerings'=>'For å forbedre våre butikktjenester','Comply with any legal obligations we have, such as calculating taxes'=>'Overholde alle juridiske forpliktelser vi har, som å beregne avgifter','Set up your account for our store'=>'Sett opp din konto for butikken vår','Process payments and prevent fraud'=>'Behandle betalinger og forhindre svindel','Respond to your requests, including refunds and complaints'=>'Svar på dine forespørsler, inkludert tilbakebetalinger og klager','Send you information about your account and order'=>'Sende deg informasjon om din konto og ordre','When you purchase from us, we’ll ask you to provide information including your name, billing address, shipping address, email address, phone number, credit card/payment details and optional account information like username and password. We’ll use this information for purposes, such as, to:'=>'Når du kjøper fra oss, ber vi deg om å gi informasjon, inkludert navn, faktureringsadresse, fraktadresse, e-postadresse, telefonnummer, kredittkort/betalingsinformasjon og valgfri kontoinformasjon som brukernavn og passord. Vi bruker denne informasjonen til for eksempel:','Note: you may want to further detail your cookie policy, and link to that section from here.'=>'Merk: du vil kanskje beskrive nærmere hvordan du bruker informasjonskapsler, og lenke til det herfra.','We’ll also use cookies to keep track of cart contents while you’re browsing our site.'=>'Vi bruker også informasjonskapsler for å holde oversikt over innholdet i handlekurven mens du surfer på nettstedet vårt.','Shipping address: we’ll ask you to enter this so we can, for instance, estimate shipping before you place an order, and send you the order!'=>'Fraktadresse: Vi ber deg om å fylle inn dette, slik at vi for eksempel kan estimere frakt før du legger inn en ordre, samt for å sende ordren til deg.','Location, IP address and browser type: we’ll use this for purposes like estimating taxes and shipping'=>'Plassering, IP-adresse og nettlesertype: Vi bruker dette til formål som estimering av avgifter og frakt','Products you’ve viewed: we’ll use this to, for example, show you products you’ve recently viewed'=>'Produkter du har sett på: Vi bruker dette til for eksempel å vise deg produkter du nylig har sett på','While you visit our site, we’ll track:'=>'Når du besøker nettsiden vår, samler vi:','What we collect and store'=>'Hva vi samler og lagrer','We collect information about you during the checkout process on our store.'=>'Vi samler inn informasjon om deg under betalingsprosessen i vår butikk.','This sample language includes the basics around what personal data your store may be collecting, storing and sharing, as well as who may have access to that data. Depending on what settings are enabled and which additional plugins are used, the specific information shared by your store will vary. We recommend consulting with a lawyer when deciding what information to disclose on your privacy policy.'=>'Denne eksempelteksten inneholder det grunnleggende om hvilke personlige data butikken kan samle inn, lagre og dele, samt hvem som har tilgang til dataene. Avhengig av hvilke innstillinger som er aktivert, og hvilke utvidelser som brukes, vil den spesifikke informasjonen som er delt av butikken variere. Vi anbefaler at man rådføre seg med en advokat når man bestemmer hvilken informasjon som skal tas med i personvernerklæringen.','Token'=>'Nøkkel','Payment Tokens'=>'Betalingsnøkler','Access granted'=>'Tilgang tillatt','Download count'=>'Antall nedlastinger','User email'=>'Bruker e-postadresse','Browser User Agent'=>'Nettleser brukeragent','Items Purchased'=>'Produkter kjøpt','Order Number'=>'Ordrenummer','Download ID'=>'Nedlastnings-ID','Access to Purchased Downloads'=>'Adgang til kjøpte nedlastinger','Purchased Downloads'=>'Kjøpte nedlastinger','Customer Data'=>'Kunde data','Removed payment token "%d"'=>'Fjernet betalingsnøkkel