ther or not WordPress is using an external object cache.'=>'Viser om WordPress bruker et eksternt objektmellomlager eller ikke.','External object cache'=>'Eksternt mellomlager for objekter','WordPress cron'=>'WordPress cron','WordPress debug mode'=>'WordPress debug modus','WordPress memory limit'=>'WordPress minnegrense','WordPress multisite'=>'WordPress multisite','%1$s - There is a newer version of WordPress available (%2$s)'=>'%1$s - Der er en nyere versjon av WordPress tilgjengelig (%2$s)','WordPress version'=>'WordPress versjon','WooCommerce version'=>'WooCommerce versjon','Settings tab labelPayments'=>'Betalinger','Enable coupons'=>'Aktiver rabattkoder','Rates will be configurable and taxes will be calculated during checkout.'=>'Satser vil bli konfigurerbar og avgift vil bli beregnet ved betaling.','Enable tax rates and calculations'=>'Aktiver avgiftssatser og beregninger','Manage'=>'Administrer','Account endpoints'=>'Konto sluttpunkter','Secure checkout'=>'Sikker betaling','Legacy API'=>'Legacy API','Retain completed orders for a specified duration before anonymizing the personal data within them.'=>'Behold fullførte ordre for en bestemt varighet før anonymisering av personopplysningene i dem.','Retain completed orders'=>'Behold fullførte ordrer','Cancelled orders are unpaid and may have been cancelled by the store owner or customer. They will be trashed after the specified duration.'=>'Kansellerte ordrer er ubetalte og kan ha blitt kansellert av butikkens eier eller kunde. De flyttes til papirkurven etter den angitte perioden.','Retain cancelled orders'=>'Behold kansellerte ordrer','Failed orders are unpaid and may have been abandoned by the customer. They will be trashed after the specified duration.'=>'Mislykkede ordrer er ubetalte og kan ha blitt forlatt av kunden. De flyttes til papirkurven etter den angitte perioden.','Retain failed orders'=>'Behold mislykkede ordrer','Pending orders are unpaid and may have been abandoned by the customer. They will be 