 til litt tekst om butikkens personvernerklæring for visning på registreringsskjemaer for kontoer.','Registration privacy policy'=>'Personvernerklæring for registrering','privacy page'=>'personvernside','This section controls the display of your website privacy policy. The privacy notices below will not show up unless a %s is set.'=>'Denne delen styrer visning av nettstedets personvernerklæring. Personvernnotisene nedenfor vises ikke med mindre en «%s» er angitt.','Privacy policy'=>'Personvernerklæring','Removed personal data from %s order.'=>'Fjernet personopplysninger fra %s ordre.' . "\0" . 'Fjernet personopplysninger fra %s ordrer.','Account erasure requests'=>'Forespørsler om sletting av brukerkontoer','Accounts &amp; Privacy'=>'Kontoer og personvern','List of allowed billing emails to check against when an order is placed. Separate email addresses with commas. You can also use an asterisk (*) to match parts of an email. For example "*@gmail.com" would match all gmail addresses.'=>'Liste over tillatte e-poster for fakturering å kontrollere mot når en ordre opprettes. Skill e-postadresser med komma. Du kan også bruke en stjerne (*) for samsvar mot deler av en e-post. For eksempel vil «*@gmail.com» samsvare med alle Gmail-adresser.','Allowed emails'=>'Tillatte e-posteradresse','Filter by registered customer'=>'Filtrer på registrert kunde','Remove personal data'=>'Fjern personlige opplysninger','Use previous column mapping preferences?'=>'Bruk tidligere innstillinger for kolonnetilordning?','View &amp; Customize'=>'Vis &amp; tilpass','Review Settings'=>'Omtaleinnstillinger','Visit Dashboard'=>'Gå til kontrollpanelet','You can also:'=>'Du kan også:','You\'re ready to add products to your store.'=>'Du er klar til å legge til produkter i butikken din.','Create some products'=>'Opprett noen produkter','Continue with WooCommerce Services'=>'Fortsett med WooCommerce tjenester','Connect your store to activate WooCommerce Services'=>'Koble til din butikk for å aktivere Wo